import React from 'react';
import Container from "@mui/material/Container";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import WaterInput from './WaterInput';

const WaterBody = () => {
  return (
    <Container sx={{width: 1000, height: 500, backgroundColor: "white", borderRadius: 5}}>
        <Box sx={{ height: 450, width: 550, border: "1px solid black"}}>

        </Box>
        <Box sx={{ position: "absolute", mt: 0, ml: 5}}>
            <WaterInput />
        </Box>
    </Container>
  )
}

export default WaterBody;
